import React from "react";
import SideBar from "./Sidebar";

function SearchResult() {
  return (
    <div>
      <h1>Search Results</h1>
      <SideBar pageWrapId={"page-wrap"} outerContainerId={"App"} />
    </div>
  );
}

export default SearchResult;
